export const IcoBS = ()=>{
    return <img src="/images/icones/bootstrap.png" alt="Bootstrap" title="Bootstrap"/>
}

export const IcoSS = ()=>{
    return <img className="ico" src="/images/icones/sass.png" alt="SCSS" title="SCSS" />
}

export const IcoHTML = () =>{
    return <img className="ico" src="/images/icones/html-5.png" alt="HTML" title="HTML" />
}

export const IcoCSS = () =>{
    return <img className="ico" src="/images/icones/css-3.png" alt="CSS" title="CSS" />
}

export const IcoJS = () =>{
    return <img className="ico" src="/images/icones/js.png" alt="Javascript" title="Javascript" />
}

export const IcoRc = () =>{
    return <img className="ico" src="/images/icones/react.png" alt="ReactJs" title="ReactJs" />
}

export const IcoNx = () =>{
    return <img className="ico" src="/images/icones/nextjs-logo.png" alt="NextJs" title="NextJs" />
}

export const IcoGH = () =>{
    return <img className="ico" src="/images/icones/github.png" alt="GitHub" />
}

